import styled from 'styled-components';

export const NavbarContainer = styled.div`
    width: 100%;
    height: 80px;
    position: sticky;
    top: 0;
    z-index: 99;
    background-color: #49426c
    `;

    export const NavbarWrapper = styled.div`
    margin: auto;
    width: 100px;
    max-width: 1300px;
    height: 100%;
    align.items: center;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    border: 1px solid yellow
    `;
